    [TestClass]
    public class MorganAndStringTests
    {
        [TestMethod]
        public void ArrangeLexicographically_Test_1()
        {
            //Arrange
            string s1 = "JACK";
            string s2 = "DANIEL";

            string expected = "DAJACKNIEL";

            //Act
            var actual = MorganAndString.ArrangeLexicographically(s1, s2);

            //Assert
            Assert.AreEqual(expected, actual);
        }

         [TestMethod]
        public void ArrangeLexicographically_Test_2()
        {
            //Arrange
            string s1 = "ABACABA";
            string s2 = "ABACABA";

            string expected = "AABABACABACABA";

            //Act
            var actual = MorganAndString.ArrangeLexicographically(s1, s2);

            //Assert
            Assert.AreEqual(expected, actual);
        }

